// ==UserScript==
// @name         	WaniKani 100% Review Fanfare
// @namespace    	https://github.com/ThisIsntTheWay
// @description  	100% review score is hard! Congratulate yourself with a wonderful fanfare!
// @version      	0.5.1
// @author       	Jon Cousins, ThisIsntTheWay
// @include      	http*://*.wanikani.com/review/*
// @grant	  		GM_registerMenuCommand
// @run-at    		document-end
// @downloadURL https://update.greasyfork.org/scripts/446584/WaniKani%20100%25%20Review%20Fanfare.user.js
// @updateURL https://update.greasyfork.org/scripts/446584/WaniKani%20100%25%20Review%20Fanfare.meta.js
// ==/UserScript==

// Local storage object namings
let lsJinglePlayedFlagname = "wkReviewJinglePlayed";
let lsJinglePlayAlwaysFlagname = "wkReviewJinglePlayAlways";
let lsJingleConfettiFlagname = "wkReviewConfettiEnabled";
let lsJingleDataFlagname = "wkReviewJingleData";
let logPrefix = 'WaniKani 100% Review Fanfare: ';

// External confetti JS
let confettiJS = document.createElement('script');
	confettiJS.src = "https://cdn.jsdelivr.net/npm/js-confetti@latest/dist/js-confetti.browser.js";
	confettiJS.setAttribute("type", "text/javascript");
document.body.appendChild(confettiJS);	

function GMsetup() {
  if (GM_registerMenuCommand) {
		// Set jingle
		GM_registerMenuCommand('WaniKani 100% Review Fanfare: Set jingle', function() {
			let a = localStorage.getItem(lsJingleDataFlagname) || false;
			let aText = ((a !== null) ? 'Set' : 'Not set');
			
			let dataType = "";
			if (a) {
				dataType = a.substring(0, a.indexOf(","));
				let tmp = dataType.substring(0, dataType.indexOf("/"));
				
				// If dataType does not begin with data:audio, then it must be an URL.
				// This check does not account for possible edge cases and is kinda bad, but whatever.
				if (tmp != "data:audio") {
					dataType = "URL (" + a + ")";
				}
			}
			
			let sizeText = "";
			if ((dataType.substring(0, dataType.indexOf("/"))) == "data:audio") {
				// Calc b64 data size
				let size = a ? a.substring(a.indexOf(',') + 1) : false;
				sizeText = (size) ? String(" (" + atob(size).length + " bytes)") : '';
			}

			let b = prompt("Jingle data: " + aText + sizeText + ".\nType: " + dataType + "\n\nEnter an URL to an MP3 or data encoded as a b64 data URI:");
			if (b) {
				// ToDo: Validate input
				localStorage.setItem(lsJingleDataFlagname, b);
			}
		});

		// Play jingle
		GM_registerMenuCommand('WaniKani 100% Review Fanfare: Preview jingle', function() {
			let a = localStorage.getItem(lsJingleDataFlagname) || false;
			if (a !== null) {
				createAudio();
			} else {
				alert("A jingle has not been set.");
			}
		});

		// Toggle jingle
		GM_registerMenuCommand('WaniKani 100% Review Fanfare: Always play jingle/confetti', function() {
			let a = localStorage.getItem(lsJinglePlayAlwaysFlagname) || "false";
			let aText = ((a === 'true') ? 'Yes' : 'No');
			
			let b = confirm("Jingle and confetti always play when opening reviews page: " + aText + ".\nPress OK to toggle value.");
			
			if (b) {
				let val = (a === 'true');
				val = !val;
				
				localStorage.setItem(lsJinglePlayAlwaysFlagname, val);
			}
		});
		
		// Toggle confetti
		GM_registerMenuCommand('WaniKani 100% Review Fanfare: Toggle confetti', function() {
			let a = localStorage.getItem(lsJingleConfettiFlagname) || "true";
			let aText = ((a === 'true') ? 'Yes' : 'No');
			
			let b = confirm("Confetti always plays when achieving a 100% score: " + aText + ".\nPress OK to toggle value.");
			
			if (b) {
				let val = (a === 'true');
				val = !val;
				
				localStorage.setItem(lsJingleConfettiFlagname, val);
			}
		});
	} else {
		console.error(logPrefix, "Error registering greasemonkey menus.");
	}
}

function createAudio() {
	// To circumvent autoplay policies, a seperate audio tag instead of 'new Audio()' will be created.
	// Tested using Chrome v101	
	let jingleData = localStorage.getItem(lsJingleDataFlagname);
		
	// Create audio tag
	var audioTag = document.createElement('audio');
		audioTag.setAttribute("autoplay", '');
	
	// Set source
	var sourceTag = document.createElement('source');
		sourceTag.setAttribute("src", jingleData);
		sourceTag.setAttribute('type', 'audio/mp3');
	
	// Assemble DOMs
	audioTag.appendChild(sourceTag);
	document.body.appendChild(audioTag);
}

(function() {
	GMsetup();
    'use strict';

	var verboseOutput = false;
    var reviewPercentage;
    var reviewResultElement = document.querySelector('#review-stats-answered-correctly .review-stats-value');
	
	// Local storage initiation
	let hasPlayedJingleAlready = localStorage.getItem(lsJinglePlayedFlagname) == "true";
	let playJingleAlways = localStorage.getItem(lsJinglePlayAlwaysFlagname) === "true";
	let jingleSourceData = localStorage.getItem(lsJingleDataFlagname);
		
		// Set playJingleAlways to false by default
		if (playJingleAlways == null) {
			localStorage.setItem(lsJinglePlayAlwaysFlagname, "false");
			playJingleAlways = false;
		} else {
			playJingleAlways = Boolean(playJingleAlways);
		}
		
		// Set default jingle data
		if (jingleSourceData == null) {
			let d = `data:audio/mpeg;base64,`;
			// BotW key item fanfare
			
			localStorage.setItem(lsJingleDataFlagname, d);
			jingleSourceData = d;
		}
		
	// Main script logic
    if (reviewResultElement == null) {
		if (verboseOutput) {
			console.log(logPrefix, "var 'reviewResultElement' is NULL, possibly not on review page.");
		}
		
		// Reset jingle flag if user enters review session page
		let currPath = document.location.pathname;
		if (currPath == "/review/session") {
			// Only update flag if this is an actual review session.
			if (document.querySelector("#user-response") != null) {
				localStorage.setItem(lsJinglePlayedFlagname, 'false');
			}
		} 
		
        return;
    } else {
		reviewPercentage = +reviewResultElement.textContent.trim();
	}

    /* Only execute if review % is actually 100 and jingle was not yet played. */
    if ((reviewPercentage == 100) && (playJingleAlways || !hasPlayedJingleAlready)) {
		try {
			createAudio();
			localStorage.setItem(lsJinglePlayedFlagname, 'true');
			
			// Play confetti
			let confetti = localStorage.getItem(lsJingleConfettiFlagname);
			if (confetti === "true") {
				confettiJS.addEventListener("load", () => {
					const jsConfetti = new JSConfetti();
					jsConfetti.addConfetti();
				});
			}
		} catch (e) {
			console.error(logPrefix, 'Error during assembly! ', e);
			return;
		}
    } else {
		if (verboseOutput) {
			console.error(logPrefix, 'Review score is not 100%.');
		}
		
        return;
	}
})();